window.bookSummaryJSON = "<p>Circe Quinn, the office manager of a moving company, goes to sleep at home and wakes up in a corral filled with women wearing sacrificial virgin attire—and she’s one of them.</p> <p>She figures this is not good and soon finds she’s not having a wild dream; she’s living a frightening nightmare. She’s been transported to a barren land populated by a primitive people, where she’s installed very unwillingly on her white throne of horns as their queen.</p> <p>Dax Lahn is the king of Suh Tunak, the Horde of the nation of Korwahk. With one look at Circe, he knows she will be his bride and together they will start the Golden Dynasty of legend.</p> <p>Circe and Lahn are separated by language, culture, and the small fact she’s from a parallel universe and has no idea how she got there. Or, more importantly, how to get home.</p> <p>Facing challenge after challenge, Circe finds her footing as Queen of the brutal Korwahk Horde and wife to its King.</p> <p>Then she finds herself falling in love with this primitive land, its people and especially their savage leader.</p>"; 
